def transform(sequence):
    transformed_seq = ''
    zeros_count = 0
    for i in range(len(sequence)):
        if sequence[i] == '0':
            zeros_count += 1
        else:
            transformed_seq += sequence[i]
            zeros_count = 0
        if zeros_count >= 2:
            transformed_seq += '0'
    return transformed_seq
